This Aint Celebrity Fit Club

Ravenous for more than just cream pies, roasted chicken, and phallic-shaped vegetables, the girls of Hustler Video`s newest parody, THIS AIN`T CELEBRITY FIT CLUB: BOOT CAMP XXX, find themselves bending to the whim of their chef, drill sergeant, doctor and nurse. Cast in the roles of these lust-hungry young ladies are porn starlets Breanne Benson, Sadie West, Violet Monroe, Briana Blair, and Leah Lexis, who engages in an incredibly filthy foursome towards the end of the film! Let`s hear it for DPs!! With Otto Bauer playing the role of the stereotypical angry drill sergeant, and the girls all more than enthusiastic during their scenes, it`s not hard to get lost in the moment and forget that this is only a movie.

